import styled from "styled-components";


export const ContainerNav = styled.div`
    width: 100vw;
    height: 100vh;
    background-color: blue;
`
export const ImageNav = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
  position: absolute;
  top: 0;
  left: 0;
`;
